const defaultState = {
    topBanners: []
}

function reducer(state = defaultState, action){
    switch (action.type) {
        case actionTypes.CHANGE_TOP_BANNER:
            return state.set('topBanners', action.topBanners)
    }

    return state;
}

export {
    reducer
}
